import "./Home.css";
import Header from "../../components/header/Header";
import React, { useEffect } from "react";
import { Base } from "../../components/Base";
import CSSProps from "../../data/constants/CSSProps";

const Home = () => {
  useEffect(() => {
    Base.prototype.SwitchPage(CSSProps.ID.Home);
  });
  return (
    <div>
      <Header className="Header" />
      <div class="columns">
        <div class="column main-column">
          <article class="article">
            <a class="article first-article">
              <figure class="article-image">
                <img src="" />
              </figure>
              <div class="article-body">
                <h2 class="article-title">Title</h2>
                <p class="article-content">Content</p>
                <footer class="article-info">Info</footer>
              </div>
            </a>
          </article>
          <article class="article">Hello World</article>
        </div>

        <div class="column">
          <article class="article">Hello World</article>
          <article class="article">Foo Bar</article>
          <article class="article">Hello World</article>
        </div>
      </div>
    </div>
  );
};

export default Home;
